import React from 'react';
import classes from './MyPosts.module.css';


function MyPosts() {
    return (
        <div>
            <div className={classes.item}>my post</div>
            <div className={classes.item}>new post</div>
            <div className={classes.item}>post 1</div>
            <div className={classes.item}>post 1</div>
        </div>
    )
}


export default MyPosts;
